import { useCallback } from "react";
import { useNavigate } from "react-router-dom";

import "./SignUp.css";
import { useEffect, useState } from "react";
import { useForm } from 'react-hook-form';
import axios from 'axios'

const SignUp = () => {



  const [form, setform ] = useState({});

  const navigate = useNavigate();

  const onFrameButtonClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onMicrosoftTeamsImage12Click = useCallback(() => {
    // Please sync "landing page" to the project
  }, []);

  const onMicrosoftTeamsImage121Click = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onContinueClick = useCallback( async(e) => {

    // validateEmail(JSON.stringify(e.target.email))

    e.preventDefault;
    const response = await fetch('http://localhost:5000/users/user',{
      method:'POST',
      body:JSON.stringify({form}),
      headers:{
        'Content-Type':'application/json'
      }
    })
    const data= await response.json();
    console.log(data) ;


    navigate("/login");
  }, [navigate]);


  const validateEmail = (email) =>
   { return email.match(/^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/ 
   );
   };
  // const validateEmail = (email) => {
  //   if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(email))
  //    {
  //      return 
  //    }
  //      alert("You are writing invalid email address!")
  //      return (false)
  //  }



const handelForm= (e)=>{
  setform({
    ...form,
    [e.target.id] : e.target.value
  })
}

 const handelSubmit= async(e)=>{
      e.preventDefault();
      const response= await fetch('/users/user',{
        method:'POST',
        body:JSON.stringify({form}),
        headers:{
          'Content-Type':'application/json'
        }
      })
      // await axios.post('/users/user')
      const data= await response.json();
      console.log(data) ;
      const name=data.name;
      console.log(name)
      console.log("test2",JSON.stringify(form))

 }



  return (

      <div>
      <div className="signup">
        <div className="sign-up1">Sign Up</div>
      </div>

      <button
      type="button"
        className="microsoftteams-image-1-2-wrapper"
        onClick={onFrameButtonClick}
      >
        <img
        type="button"
          className="microsoftteams-image-1-28"
          alt=""
          src="/microsoftteamsimage-1-21@2x.png"
          onClick={onMicrosoftTeamsImage12Click}
        />
      </button>

      <form method="POST" onSubmit={handelSubmit} >  
       <p>{JSON.stringify(form)}</p>
      <input className="name" type="text" placeholder="Name" id="username" onChange={handelForm}  />
      <input className="email" type="text" placeholder="Email" id="email"  onChange={handelForm}/>
      <input className="phone-no" type="text" placeholder="Phone No" id="phone-no" onChange={handelForm} />
      <input className="password" type="text" placeholder="Password" id="password" onChange={handelForm} />
      {/* <input className="confirm-password" type="text" id="confirmpassword" placeholder="Confirm Password" onChange={handelForm}/> */}
      <input className="dob1" type="date"  id="dob" placeholder="DOB" onChange={handelForm}/>
      <button className="continue" type="submit"  onClick={onContinueClick }    >
        Submit
      </button>
      </form>




      <div className="fixed-rectangle">
        <button
         type="button"
          className="microsoftteams-image-1-29"
          onClick={onMicrosoftTeamsImage121Click}

        />


        <div className="contact-us-parent5">
          <div className="contact-us8">Contact US</div>
          <div className="email-claimlygmailcom8">Email: claimly@gmail.com</div>
          <div className="ph-no-918">Ph No: +91 876543210</div>

        </div>
        </div>

      <img className="group-child18" alt="" src="/frame-3425.svg" /> 
      </div>


  );

};

export default SignUp;
